import React, { useState } from "react";
import "./Doctordashboard.css";

const Doctordashboard = () => {
  const [activeTab, setActiveTab] = useState(""); // Current tab
  const [profileData, setProfileData] = useState(null); // Doctor profile data
  const [availabilityList, setAvailabilityList] = useState([]); // Availability data

  const handleLogout = () => {
    alert("Logged out successfully!");
    window.location.href = "/login"; // Redirect to login
  };

  const handleProfileSubmit = (e) => {
    e.preventDefault();
    setProfileData({ name: "Dr. Smith", specialization: "Cardiology" }); // Example profile
    alert("Profile created successfully!");
  };

  const handleAddAvailability = (e) => {
    e.preventDefault();
    const newAvailability = { day: "Monday", time: "9:00 AM - 5:00 PM" };
    setAvailabilityList([...availabilityList, newAvailability]);
    alert("Availability added successfully!");
  };

  return (
    <div className="dashboard-container">
      {/* Sidebar Navigation */}
      <div className="sidebar">
        <button onClick={() => setActiveTab("Dashboard")}>Dashboard</button>
        {profileData ? (
          <button onClick={() => setActiveTab("doctorProfile")}>
            Doctor Profile
          </button>
        ) : (
          <button onClick={() => setActiveTab("createProfile")}>
            Create Profile
          </button>
        )}
        <button onClick={() => setActiveTab("addAvailability")}>
          Add Availability
        </button>
        <button onClick={() => setActiveTab("viewAppointments")}>
          View Appointments
        </button>
        <button className="doctorlogout-button" onClick={handleLogout}>
          Logout
        </button>
      </div>

      {/* Main Content */}
      <div className="main-content">
        <h1 className="dashboard-heading">Doctor Dashboard</h1>

        {/* Dashboard Tab */}
        {activeTab === "Dashboard" && (
          <div>
            <h2>Welcome to your Dashboard</h2>
            <p>View and manage your profile, availability, and appointments.</p>
          </div>
        )}

        {/* Doctor Profile Creation */}
        {activeTab === "createProfile" && (
          <div>
            <h2>Create Your Profile</h2>
            <form onSubmit={handleProfileSubmit}>
              <input
                type="text"
                placeholder="Name"
                required
              />
              <input
                type="text"
                placeholder="Specialization"
                required
              />
              <button type="submit">Save Profile</button>
            </form>
          </div>
        )}

        {/* View Doctor Profile */}
        {activeTab === "doctorProfile" && profileData && (
          <div>
            <h2>Doctor Profile</h2>
            <p>Name: {profileData.name}</p>
            <p>Specialization: {profileData.specialization}</p>
          </div>
        )}

        {/* Add Availability */}
        {activeTab === "addAvailability" && (
          <div>
            <h2>Add Your Availability</h2>
            <form onSubmit={handleAddAvailability}>
              <input
                type="text"
                placeholder="Day (e.g., Monday)"
                required
              />
              <input
                type="text"
                placeholder="Time (e.g., 9:00 AM - 5:00 PM)"
                required
              />
              <button type="submit">Add Availability</button>
            </form>
          </div>
        )}

        {/* View Appointments */}
        {activeTab === "viewAppointments" && (
          <div>
            <h2>Your Appointments</h2>
            <p>No appointments scheduled currently.</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default Doctordashboard;
